//Objetos literales
const persona = {
    nombre   : 'Gloria Amalia',
    apellidos: 'Martinez De Paula',
    edad     : 25,
    direccion: {
        ciudad   : 'Pinar del Rio',
        codPostal: 20100,
        activo   : true,
    }
}

console.log(persona);

const persona2 = persona;
